import React from 'react';
import { motion } from 'framer-motion';
import { FaUsers, FaDatabase, FaRocket, FaCode, FaChartLine, FaEnvelope, FaMobileAlt, FaCommentDots } from 'react-icons/fa';

const DataItem = ({ icon: Icon, label }) => (
  <motion.div 
    whileHover={{ scale: 1.05 }}
    className="flex items-center space-x-3 bg-gray-800 p-3 rounded-lg"
  >
    <Icon className="text-green-400 text-xl" />
    <span className="text-gray-300 text-sm font-medium">{label}</span>
  </motion.div>
);

const MetricCard = ({ title, value, icon: Icon }) => (
  <motion.div 
    whileHover={{ scale: 1.05 }}
    className="bg-gray-800 p-6 rounded-lg shadow-lg"
  >
    <div className="flex items-center justify-between mb-4">
      <h3 className="text-2xl font-bold text-white">{value}</h3>
      <Icon className="text-green-400 text-3xl" />
    </div>
    <p className="text-gray-400 text-sm">{title}</p>
  </motion.div>
);

const FeatureCard = ({ icon: Icon, title, description }) => (
  <motion.div 
    whileHover={{ scale: 1.05 }}
    className="bg-gray-800 p-6 rounded-lg shadow-lg"
  >
    <div className="bg-green-400 p-3 rounded-full w-12 h-12 flex items-center justify-center mb-4">
      <Icon className="text-gray-900 text-xl" />
    </div>
    <h3 className="text-lg font-semibold text-white mb-2">{title}</h3>
    <p className="text-gray-400 text-sm">{description}</p>
  </motion.div>
);

const CampaignStat = ({ label, value, percentage }) => (
  <div className="mb-4">
    <div className="flex justify-between items-center mb-1">
      <span className="text-sm text-gray-400">{label}</span>
      <span className="text-sm font-medium text-white">{value}</span>
    </div>
    <div className="w-full bg-gray-700 rounded-full h-2.5">
      <div className="bg-green-400 h-2.5 rounded-full" style={{ width: `${percentage}%` }}></div>
    </div>
  </div>
);

function Info3() {
  return (
    <div className="min-h-screen bg-gray-900 text-white py-20 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h1 className="text-5xl font-bold mb-4">Transform Customer Communication</h1>
          <p className="text-xl text-gray-300">Manage and tailor customer messages within one unified platform.</p>
        </motion.div>

        <div className="grid grid-cols-1 lg:grid-cols-2 gap-12">
          <div className="space-y-8">
            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.2 }}
              className="bg-gray-800 p-6 rounded-lg shadow-lg"
            >
              <h2 className="text-2xl font-bold mb-6">Spring Campaign '24</h2>
              <CampaignStat label="Email" value="66,206" percentage={70} />
              <CampaignStat label="Push" value="12,164" percentage={30} />
              <CampaignStat label="SMS" value="188,140" percentage={90} />
              <CampaignStat label="In-App" value="137,196" percentage={80} />
            </motion.div>

            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.4 }}
              className="bg-gray-800 p-6 rounded-lg shadow-lg"
            >
              <h3 className="text-xl font-semibold mb-4">DATA OPERATIONS</h3>
              <div className="grid grid-cols-2 gap-4">
                <DataItem icon={FaUsers} label="Create or Update Person" />
                <DataItem icon={FaRocket} label="Send Event" />
                <DataItem icon={FaUsers} label="Batch Update" />
                <DataItem icon={FaDatabase} label="Manual Segment Update" />
                <DataItem icon={FaDatabase} label="Query Collection" />
                <DataItem icon={FaDatabase} label="Send and Receive Data" />
              </div>
            </motion.div>
          </div>

          <div className="space-y-8">
            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.6 }}
              className="grid grid-cols-2 gap-6"
            >
              <MetricCard title="Messages sent in 2023" value="35 Billion" icon={FaEnvelope} />
              <MetricCard title="API calls per day" value="4 Billion+" icon={FaChartLine} />
            </motion.div>

            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.8 }}
              className="space-y-6"
            >
              <FeatureCard
                icon={FaRocket}
                title="JOURNEYS"
                description="Craft and automate messages with unmatched flexibility and customization."
              />
              <FeatureCard
                icon={FaDatabase}
                title="DATA PIPELINES"
                description="Collect and route your first-party data to all the tools you use to drive growth."
              />
              <FeatureCard
                icon={FaCode}
                title="PARCEL"
                description="Code, preview, and collaborate using the development platform designed for email."
              />
            </motion.div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Info3;
